jQuery(function($){let bookingEntry=$(".detail-booking-entrypoint");if(bookingEntry.length>0){let bookingEntryTransportType=$('.booking-filter-radio--transport-type input[type="radio"]');let bookingEntryAirportField=$(".booking-filter-item--airport");bookingEntryTransportType.on("change",function(e){var thisType=$(this).val();if(thisType=="FLUG"){bookingEntryAirportField.removeClass("d-none")}else{bookingEntryAirportField.addClass("d-none")}});let bookingEntryCalendar=$(".booking-filter-field--date-range");let bookingEntryCalendarRenderTarget=$("#booking-entry-calendar");let bookingEntryCalendarServiceUrl="/wp-content/themes/travelshop/pm-ajax-endpoint.php?action=detail-booking-calendar";bookingEntryCalendar.on("click touch",function(e){e.preventDefault();var getTransportType,getAirport,getDur,getOffer,getMediaObject=null;getTransportType=$('.booking-filter-radio--transport-type input[type="radio"]:checked').val();getDur=$(".booking-filter-field--duration").val();getOffer=$(".booking-filter-field--offer").val();getMediaObject=$(".booking-filter-field--mediaobject").val();if(getTransportType==="FLUG"){getAirport=bookingEntryAirportField.find('input[type="radio"]:checked').val()}renderBookingCalendar(getTransportType,getAirport,getDur,getOffer,getMediaObject);e.stopPropagation()});function requestHandlerBookingCalendar(request){$.ajax({url:bookingEntryCalendarServiceUrl,data:request,type:"POST",dataType:"html",beforeSend:function(xhr){console.log("before send");bookingEntryCalendarRenderTarget.html("");bookingEntryCalendarRenderTarget.addClass("is-loading")},success:function(data){bookingEntryCalendarRenderTarget.html(data);bookingEntryCalendarRenderTarget.removeClass("is-loading")}})}function renderBookingCalendar(transportType,airport,duration,offer,mediaobject){var calendarRequest={transport_type:transportType,airport:airport,duration:duration,offer:offer,media_object_id:mediaobject};requestHandlerBookingCalendar(calendarRequest)}}});